import React from 'react';

const Header = () => {
  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <header>
      <div className="container header-content">
        <img src="images/profile.jpg" alt="Profile" className="profile-img" />
        <div>
          <h1>Monisha TG</h1>
          <p>Web Developer | Aspiring Software Engineer | Java Developer Enthusiast | Full-Stack Developer (Fresher) | Software Engineer Trainee</p>
          <a href="images/Monisha_portfolio.pdf" download className="btn">ðŸ“„ Download Resume</a>
        </div>
      </div>
      <nav>
        <a href="#about" onClick={(e) => { e.preventDefault(); scrollToSection('about'); }}>About</a>
        <a href="#skills" onClick={(e) => { e.preventDefault(); scrollToSection('skills'); }}>Skills</a>
        <a href="#projects" onClick={(e) => { e.preventDefault(); scrollToSection('projects'); }}>Projects</a>
        <a href="#contact" onClick={(e) => { e.preventDefault(); scrollToSection('contact'); }}>Contact</a>
      </nav>
    </header>
  );
};

export default Header;
